'''keys: Solutions:Similar:T:S:'''from typing import Listclass Solution:    # T: O(n^2), n for loop and n for each insertion    # O(n) for S for the res    def reconstructQueue(self, people: List[List[int]]) -> List[List[int]]:        people.sort(key = lambda x: (-x[0]))        print (people)        res = []        for p in people:            res.insert(p[1], p)        return res    sol = Solution()print (sol.reconstructQueue([[9,0],[7,0],[1,9],[3,0],[2,7],[5,3],[6,0],[3,4],[6,2],[5,2]]))